#include "common.h"
using namespace std;

namespace numDecodings {
/*
// TODO: copy problem statement here
 639. Decode Ways II
 Hard
 
 275
 
 376
 
 Favorite
 
 Share
 A message containing letters from A-Z is being encoded to numbers using the following mapping way:
 
 'A' -> 1
 'B' -> 2
 ...
 'Z' -> 26
 Beyond that, now the encoded string can also contain the character '*', which can be treated as one of the numbers from 1 to 9.
 
 Given the encoded message containing digits and the character '*', return the total number of ways to decode it.
 
 Also, since the answer may be very large, you should return the output mod 109 + 7.
 
 Example 1:
 Input: "*"
 Output: 9
 Explanation: The encoded message can be decoded to the string: "A", "B", "C", "D", "E", "F", "G", "H", "I".
 Example 2:
 Input: "1*"
 Output: 9 + 9 = 18
 Note:
 The length of the input string will fit in range [1, 105].
 The input string will only contain the character '*' and digits '0' - '9'.
 */

class Solution {
public:
    int numDecodings(string s) {
        int n = s.size();
        string ns;
        ns.reserve(n);
        ns.push_back(s[0]);
        for (int i = 1; i < n; ++i) {
            if (s[i-1] >= '3' && s[i-1] <= '9' && s[i] >= '3' && s[i] <= '9') {
                continue;
            }
            ns.push_back(s[i]);
        }
        
        
        // from last character forward to the first
        n = ns.size();
        vector<long> memo(2, 0);
        memo[1] = 1;
        int i = n - 1;
        if (ns[i] == '*') {
            memo[0] = 9;
        } else if (ns[i] >= '1' && ns[i] <= '9') {
            memo[0] = 1;
        }
        
        for (--i; i >= 0; --i) {
            long res = 0;
            char c = ns[i];
            char cn = ns[i+1];
            if (c == '1') {
                if (cn == '0') {
                    res = memo[1];
                } else if (cn >= '1' && cn <= '9') {
                    res = memo[0] + memo[1];
                } else { // "*"
                    res = memo[0] + 9 * memo[1];
                }
            } else if (c == '2') {
                if (cn == '0') {
                    res = memo[1];
                } else if (cn >= '1' && cn <= '6') {
                    res = memo[0] + memo[1];
                } else if (cn >= '7' && cn <= '9') {
                    res = memo[1];
                } else { // "*"
                    res = memo[0] + 6 * memo[1];
                }
            } else if (c >= '3' && c <= '9') {
                res = memo[0];
            } else if (c == '*') { // *
                if (cn == '0') {
                    res = 2 * memo[1];
                } else if (cn >= '1' && cn <= '6') {
                    res = 9 * memo[0] + 2 * memo[1];
                } else if (cn >= '7' && cn <= '9') {
                    res = 9 * memo[0] + memo[1];
                } else { // '*'
                    res = 9 * memo[0] + 15 * memo[1];
                }
            }
            
            memo[1] = memo[0];
            res %= 1000000007;
            memo[0] = res;
        }
        return memo[0];
    }
    /**
     * Recursive + memo:
     *  too many call stacks.
     */
    int numDecodings_recur(string s) {
        int n = s.size();
        string ns;
        ns.reserve(n);
        ns.push_back(s[0]);
        for (int i = 1; i < n; ++i) {
            if (s[i-1] >= '3' && s[i-1] <= '9' && s[i] >= '3' && s[i] <= '9') {
                continue;
            }
            ns.push_back(s[i]);
        }
        // shrink s by squeezing consecutive 3~9's into one character
        unordered_map<int, long> memo;
        return recur(ns, 0, memo);
    }

private:
    long recur(string s, int i, unordered_map<int, long>& memo) {
        int n = s.size();
        if (i >= n) {
            return 1;
        } else if (i == n-1) {
            if (s[i] == '*') {
                return 9;
            } else if (s[i] == '0') {
                return 0;
            } else {
                return 1;
            }
        }
        
        auto it = memo.find(i);
        if (it != memo.end()) {
            return it->second;
        }
        
        long res = 0;
        char c = s[i];
        char cn = s[i+1];
        if (c >= '3' && c <= '9') {
            res = recur(s, i+1, memo);
        } else if (c == '2') {
            if (cn == '0') {
                res = recur(s, i+2, memo);
            } else if (cn >= '1' && cn <= '6') {
                res = recur(s, i+1, memo) + recur(s, i+2, memo);
            } else if (cn >= '7' && cn <= '9') {
                res = recur(s, i+2, memo);
            } else { // "*"
                res = recur(s, i+1, memo) + 6 * recur(s, i+2, memo);
            }
        } else if (c == '1') {
            if (cn == '0') {
                res = recur(s, i+2, memo);
            } else if (cn >= '1' && cn <= '9') {
                res = recur(s, i+1, memo) + recur(s, i+2, memo);
            } else { // "*"
                res = recur(s, i+1, memo) + 9 * recur(s, i+2, memo);
            }
        } else if (c == '*') {
            if (cn == '0') {
                res = 2 * recur(s, i+2, memo);
            } else if (cn >= '1' && cn <= '6') {
                res = 9 * recur(s, i+1, memo) + 2 * recur(s, i+2, memo);
            } else if (cn >= '7' && cn <= '9') {
                res = 9 * recur(s, i+1, memo) + recur(s, i+2, memo);
            } else { // '*'
                res = 9 * recur(s, i+1, memo) + 15 * recur(s, i+2, memo);
            }
        }
        
        res %= 1000000007;
        memo[i] = res;
        return res;
    }
};

}

